  false,\n\t\"url\": null,\n\t\"notes\": \"Hillside National Wildlife Refuge consists
  of about 16,000 acres in the Mississippi/Yazoo River alluvial plain, at the foot
  of the loess bulff hills, in Holmes and Yazoo Counties, Mississippi. The Army Corps
  of Engineers purchased the refuge lands under the Hillside Floodway, Yazoo Basin
  Project (1964) and transferred the property to the Fish and Wildlife Service in
  1974. A cutoff levee along the west edge of the refuge and a bluff on the east side
  form an elongated floodway that functions as a sediment collection area for Black
  and Fannegusha Creeks. Sedimentation altered the vegetative composition on a large
  portion of the north end of the refuge.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
